import React, { useEffect } from 'react';

const MapComponent = () => {
  useEffect(() => {
    // Cargar la API de Google Maps
    loadGoogleMaps();
  }, []);

  const loadGoogleMaps = () => {
    const script = document.createElement('script');
    script.src = `https://maps.googleapis.com/maps/api/js?key=YOUR_API_KEY&libraries=marker&callback=initializeMap`;
    script.async = true; // Carga asíncrona
    script.defer = true; // Retrasa la ejecución
    document.body.appendChild(script);
  };

  const initializeMap = () => {
    const mapElement = document.getElementById('map'); // Asegúrate de que este ID exista en tu HTML
    const map = new google.maps.Map(mapElement, {
      center: { lat: -34.397, lng: 150.644 }, // Coordenadas de ejemplo
      zoom: 8,
    });

    // Ejemplo de agregar un marcador
    const marker = new google.maps.Marker({
      position: { lat: -34.397, lng: 150.644 }, // Coordenadas del marcador
      map: map,
      title: '¡Hola mundo!',
    });
  };

  return (
    <div>
      <h1>Mi Mapa</h1>
      <div id="map" style={{ height: '500px', width: '100%' }}></div>
    </div>
  );
};

export default MapComponent;
